import { Text, View, TextInput, TouchableHighlight,StyleSheet } from "react-native";

export default function AddNewCourse() {
    return (
        <View style={styles.container}>
            <TextInput style={styles.input} />
            <TextInput style={styles.input} />
            <TextInput style={styles.input} />
            <TouchableHighlight>
                <Text>Submit</Text>
            </TouchableHighlight>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
    },
    input: {
        width: "80",
        borderWidth: 1,
        margin: 10
    },
    button: {
        borderWidth: 1,
        borderColor: '#0066CC',
        borderRadius: 14,
        paddingHorizontal: 10,
        paddingVertical: 3,
        backgroundColor: '#fff',
    }
});
